import React from 'react'
import './styles/Contact.css'

const Contact = () => {
    return (
      <div className="con-container">
        <h1>Contact Us</h1>
        <p>For inquiries, reach out via email or phone.</p>
      </div>
    );
  };
  
  export default Contact;
